import React from "react";
function Intro() {
  return (
    <div className="intro">
      <h2>Hi there, and welcome to Quietly Thriving.</h2>
      <p>
        My name is Natascha Henriksen and I am a mindset + business coach for
        introverted women.
      </p>
    </div>
  );
}

export default Intro;
